import React from "react";

const Coordinates = [
  { /* kaleci */ min: { x: 302, y: 662 }, max: { x: 349, y: 555 } },
  { /* stoperler */ min: { x: 353, y: 769 }, max: { x: 673, y: 456 } },
  { /* arka alt stoperler */ min: { x: 302, y: 769 }, max: { x: 351, y: 669 } },
  { /* arka üst stoperler */ min: { x: 304, y: 555 }, max: { x: 354, y: 456 } },
  { /* sahte defanslar */ min: { x: 676, y: 769 }, max: { x: 877, y: 456 } },
  { /* Bekler üst */ min: { x: 302, y: 456 }, max: { x: 672, y: 216 } },
  { /* sahte bekler üst */ min: { x: 672, y: 456 }, max: { x: 877, y: 216 } },
  {
    /* Sahte kanatlar üst */ min: { x: 877, y: 456 },
    max: { x: 1076, y: 216 },
  },
  { /* kanatlar üst */ min: { x: 1076, y: 456 }, max: { x: 1493, y: 216 } },
  { /* bekler Alt */ min: { x: 306, y: 1011 }, max: { x: 673, y: 771 } },
  { /* sahte bekler alt */ min: { x: 673, y: 1011 }, max: { x: 877, y: 771 } },
  {
    /* sahte kanatlar alt */ min: { x: 877, y: 1011 },
    max: { x: 1075, y: 771 },
  },
  { /* kanatlar alt */ min: { x: 1075, y: 1011 }, max: { x: 1493, y: 771 } },
  { /* orta saha */ min: { x: 881, y: 769 }, max: { x: 1077, y: 456 } },
  { /* forvet arkası */ min: { x: 1077, y: 769 }, max: { x: 1355, y: 456 } },
  { /* forvet */ min: { x: 1355, y: 769 }, max: { x: 1493, y: 457 } },
];

const Field = () => {
  return (
    <div
      style={{
        position: "absolute",
        width: "100%",
        height: "100%",
      }}
    >
      {Coordinates.map((coord, index) => {
        const width = coord.max.x - coord.min.x;
        const height = coord.min.y - coord.max.y;
        return (
          <div
            key={index}
            style={{
              position: "absolute",
              left: `${coord.min.x}px`,
              top: `${coord.max.y}px`,
              width: `${width}px`,
              height: `${height}px`,
              backgroundColor: "rgba(0, 128, 255, 0.3)",
              border: "1px solid #0077ff",
            }}
          />
        );
      })}
    </div>
  );
};

export default Field;
